        display: "flex",
        justifyContent: "space-between",
        width: "100%",
        border: "2px solid red"
    };

    return (
        <>
            <p>Key:</p>
            <div style={keyDivStyle}>
                <p style={{ width: "80%",  height: "100%", border: "1px solid grey"}}>{key}</p>
                <Button>Copy</Button>
            </div>


        </>
    )
}

export default Key
